const randomToTen = () => {
    const base = Date.now() * Math.random();
    return Number.parseInt(base % 10);
}

const randomToX = (x) => {
    const base = Date.now() * Math.random() * 5558;
    return Math.random() % x;
}

module.exports = {
    randomToTen,
    randomToX
};
